import React, { useState } from 'react';
import '../../App.css';

/*
export default function SignUp() {
	return <ul className='sign-up'>
	<h1>pagina teste 4</h1>
	<h3> ainda esta em construção</h3>
	</ul>
}*/
const SignUp = () => {

	const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [username, setUsername] = useState('');
	const [password, setPassword] = useState('');

const submitHandler = (event) => {
	event.preventDefault();
	console.log('submit buttom is pressed')
}

	return (
		<ul className='sign-up'>
			<div>
				<form onSubmit={submitHandler}>
					<h6>Register</h6>
					<p>name: <input type="text" value={name} onChange={event => setName(event.target.value)} /> </p><br/>
					email: <input type="text" value={email} onChange={event => setEmail(event.target.value)} /> <br/>
					username: <input type="text" value={username} onChange={event => setUsername(event.target.value)} /> <br/>
					password: <input type="text" value={password} onChange={event => setPassword(event.target.value)} /> <br/>
					<input type="submit" value="Register" />
				</form>
			</div>
		</ul>
	)
}

export default SignUp;
